Actie / Avontuur
136 minuten

goed

met Kevin Costner, Ashton Kutcher en Melissa Sagemiller

Ben Randall (Kevin Costner), een legendarische reddingszwemmer, is met zijn bemanning neergestort waardoor hij niet meer optimaal 
zijn werk kan doen. Hij wordt naar een school voor reddingszwemmers in opleiding gestuurd. Daar steekt een leerling, Jake Fischer 
(Ashton Kutcher), met kop en schouders boven iedereen uit. Ben geeft Jake de opdracht om met hem mee te gaan naar Alaska voor een 
levensgevaarlijke reddingsmissie.
